import React from 'react';
import stlPag  from './Paginated.module.css';

const Paginated = () => {
  return (
    <div className={stlPag.pagCont}>
        <button>←</button>
        <button>#</button>
        <button>→</button>
    </div>
  )
}

export default Paginated
